import emoji from "react-easy-emoji";

const user_name = {
    title : "Hello Again!",
    content : "私たちとつながって、さらに詳しく調べてください。",
    next : "行こう",
    noMember : "Not a member?",
    register : "Register Now",
    username_placeholder : "Username",
    contact : "Contact Me"
}
export {
    user_name
};
